import React from 'react';
import Navigation from './components/Navigation.js';
import Banner from './components/Banner.js';
import Information from './components/Information.js';

function App() {
  return (
    <div>
      <Navigation />
      <Banner />
      <Information />
    </div>
  );
}

export default App;
